 import {Link} from 'react-router-dom';

const Navigation = () => {
  return (
    <>
        <div className='navbar flex'>
            <img className='logo h-8' src='../images/logo.png'></img>
        <Link to="/">HOME</Link>
        <Link to="/about">ABOUT</Link>

        </div>
    </>
  )
}

export default Navigation
